

/* eslint-disable camelcase */

'use strict';

// MODULES //

var setReadOnly = require( '@stdlib/utils-define-read-only-property' );
var binary = require( '@stdlib/gsheets/math/tools/binary' );
var d_d = require( '@stdlib/gsheets/math/tools/wrap-unary' );
var dd_d = require( '@stdlib/gsheets/math/tools/wrap-binary' );
var ddd_d = require( '@stdlib/gsheets/math/tools/wrap-ternary' );
var dddd_d = require( '@stdlib/gsheets/math/tools/wrap-quaternary' );
var ddddd_d = require( '@stdlib/gsheets/math/tools/wrap-quinary' );
var ternary = require( '@stdlib/gsheets/math/tools/ternary' );
var unary = require( '@stdlib/gsheets/math/tools/unary' );


// MAIN //

/**
* Adds APIs to a provided namespace.
*
* @private
* @param {Object} dest - destination namespace
* @returns {Object} destination namespace
*/
function namespace( dest ) {
	setReadOnly( dest, 'binary', binary );
	setReadOnly( dest, 'd_d', d_d );
	setReadOnly( dest, 'dd_d', dd_d );
	setReadOnly( dest, 'ddd_d', ddd_d );
	setReadOnly( dest, 'dddd_d', dddd_d );
	setReadOnly( dest, 'ddddd_d', ddddd_d );
	setReadOnly( dest, 'ternary', ternary );
	setReadOnly( dest, 'unary', unary );
	return dest;
}


// EXPORTS //

module.exports = namespace;
